import { useState } from "react";

const Filter2 = ({onSelection}) => {

    const [name, setName] = useState('')
    
       function handleChange(e) {
           setName(e.target.name);
           onSelection(e);
       }

       return (
        <button
          onSelection={handleChange} 
          name={name} 
        />
    )
}

export default Filter2;
